import logo from './logo.svg';
import Body from './Components/body/index';
import './App.css';
import Sidebar from './Components/sidebar';

function App() {
  return (
    <div className="App">
      <div className='w-100'>
        <div className='w-25'>
          <Body />
        </div>
        <div className='w-75'>
          <Sidebar />
        </div>
      </div>
    </div>
  );
}

export default App;
